            return Responses.send201(res, "Member Successfully Created", {
              member: {
                firstname: member.firstname,
                lastname: member.lastname
              },
              createdOn: member.createdOn
            });
          })
          .catch(err => {
            return Responses.send404(res, err);
          });
      }
    });
  }
}

export default memberController;

